import React, { useState, useEffect } from 'react';
import { getFastingPlans } from './apiService';

// Main App component for ONE - Intermittent Fasting React client
function App() {
  const [plans, setPlans] = useState(null);

  // Fetch fasting plans on component mount
  useEffect(() => {
    const fetchPlans = async () => {
      const data = await getFastingPlans();
      setPlans(data);
    };
    fetchPlans();
  }, []);

  // Render function: returns the JSX structure for the main page
  return (
    <div>
      {/* Header for the application */}
      <h1>Welcome to ONE - Intermittent Fasting</h1>
      {/* Brief description or purpose of the application */}
      <p>This health web app helps you track intermittent fasting and manage premium features.</p>

      {/* Display the fasting plans response */}
      {plans && (
        <div>
          <h2>Fasting Plans</h2>
          <pre>{JSON.stringify(plans, null, 2)}</pre>
        </div>
      )}
    </div>
  );
}

// Exporting the App component as default for use in index.js and elsewhere
export default App;
